import React, { Component } from "react";
import { withScriptjs, withGoogleMap, GoogleMap, Marker } from "react-google-maps";

class Contact extends Component {
    render() {
        const MyMapComponent = withScriptjs(withGoogleMap((props) =>
            <GoogleMap
                defaultZoom={8}
                defaultCenter={{ lat: -34.397, lng: 150.644 }}
            >
                {props.isMarkerShown && <Marker position={{ lat: -34.397, lng: 150.644 }} />}
            </GoogleMap>))
        return (
            <div>
                <h1>Kontakt</h1>
                <h2>POLITECHNIKA BIAŁOSTOCKA</h2>
                <MyMapComponent 
                    isMarkerShown 
                    googleMapURL="https://maps.googleapis.com/maps/api/js?sensor=false"
                    loadingElement={<div style={{ height: `100%` }} />}
                    containerElement={<div style={{ height: `400px` }} />}
                    mapElement={<div style={{ height: `100%` }} />}
                />
                <p>ul. Wiejska 45A, 15-351 Białystok</p>
                <p>tel. 85 746 90 00, fax 85 746 90 15</p>
                <p>REGON: 000001672 NIP: 542-020-87-21</p>
            </div>
        );
    }
}

export default Contact;
